function getInputDoc() {
  return Array.from(document.getElementsByClassName("ChatBox Product")[0].getElementsByTagName("input")).slice(1).filter(e => $._data(e, "events") !== undefined)[0];
}

function getStartWord() {
  return Array.from(document.getElementsByClassName("jjo-display ellipse")).filter(e => Object.getOwnPropertyNames(e).length > 0)[0].innerText;
}

function getRandomWord(startWord) {
  const wordList = list.filter(e => e.startsWith(startWord));
  return wordList[Math.floor(Math.random() * wordList.length)];
}

var observer = new MutationObserver(function(mutations) {
    mutations.forEach(function(mutationRecord) {
        if (mutationRecord.target.style.display === "block") {
          let startWord = getStartWord();
          let randomWord = "";

          if (startWord.includes("(")) {
            startWord = startWord.replace(")", "").split("(");
            randomWord = startWord.map(e => getRandomWord(e)).filter(e => e !== undefined);
            randomWord = randomWord[Math.floor(Math.random() * randomWord.length)];
          } else {
            randomWord = getRandomWord(startWord);
          }

          getInputDoc().value = (randomWord || "");
        }
    });    
});

var target = document.getElementsByClassName("GameBox Product")[0].getElementsByClassName("game-input")[0];
